import React, { Component } from 'react';
import { TabContent, TabPane, Row } from 'reactstrap';
import { Table, Column, RenderMode } from '@blueprintjs/table';
import Sidebar from '../../components/Sidebar/Sidebar';
import SidebarItem from '../../components/Sidebar/SidebarItem';
import CreateUserCard from './components/CreateUserCard';
import UsersListCard from './components/UsersListCard';

export default class AdminPanel extends Component {
   state = {
      selected: 'users'
   };

   changeSelection(id) {
      this.setState({ selected: id });
   }

   render() {
      const { selected } = this.state;
      return (
         <div>
            <Sidebar>
               <SidebarItem
                  icon='user'
                  selected={selected === 'users'}
                  onClick={() => this.changeSelection('users')}
               />
               <SidebarItem
                  icon='properties'
                  selected={selected === 'properties'}
                  onClick={() => this.changeSelection('properties')}
               />
            </Sidebar>
            <Table numRows={50} renderMode={RenderMode.BATCH}>
               <Column />
               <Column />
               <Column />
               <Column />
               <Column />
               <Column />
               <Column />
               <Column />
               <Column />
            </Table>
            <TabContent activeTab={selected}>
               <TabPane tabId='users'>
                  <Row>
                     <CreateUserCard />
                     <UsersListCard />
                  </Row>
               </TabPane>
               <TabPane tabId='properties'>Properties</TabPane>
            </TabContent>
         </div>
      );
   }
}
